import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css'; // Link to the CSS file

function Home() {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Add your logout logic here (e.g., clearing session, localStorage, etc.)
        navigate('/'); // Navigate to login page after logout
    };

    return (
        <div className="home-container">
            <div className="home-content-container">
                <h1 className="home-title">Welcome to Your Dashboard</h1>

                <div className="home-nav-options">
                    <button className="nav-option-btn">Dashboard</button>
                    <button className="nav-option-btn">Submit Ideas</button>
                    <button className="nav-option-btn">View Ideas</button>
                    <button className="nav-option-btn">My Profile</button>
                    <button className="nav-option-btn">My Rewards</button>
                </div>

                <button className="btn-home" onClick={handleLogout}>
                    Log Out
                </button>

                <div className="logout-link">
                    <a href="/" className="logout-link-text">Log Out</a>
                </div>
            </div>
        </div>
    );
}

export default Home;
